import React from 'react';
import { View, Text, StyleSheet, Button } from 'react-native';
import {LinearGradient}from 'expo-linear-gradient';
import FirstScreen from './view/FirstSceen';
const App = () => {
  return (
    <View style={styles.container}>

    <FirstScreen></FirstScreen>


    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#00CCF9',

  },
  background: {
    ...StyleSheet.absoluteFillObject,
  },

  view1: {
    flex: 1,
    circle: {
      width: 140,
      height: 140,
      borderRadius: 9999,
      backgroundColor: '#E3C000',
      position: 'absolute',
      top: -70,
      left: 20,
    },
  },

  view2: {
    flex: 1,
    title: {
      fontSize: 40,
      fontWeight: 'bold',
      color: '#FFFFFF',
      textAlign: 'center',
      marginTop: 100,
    },
  },

  view3: {
    flex: 1,
    title: {
      fontSize: 20,
      fontWeight: 'bold',
      color: '#FFFFFF',
      textAlign: 'center',
      marginTop: 100,
    },
  },

  view4: {
    flex: 1,
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    width: 300,
    height: 100,
    marginTop: 100,
  },
});

export default App;
